import {useParams} from "react-router-dom";

const params = useParams();

function DataPage(){

    const list = [
        {
            name: 'Sarah',
            age: 21,
            color:'purple',
            id: 1
        },
        {
            name: 'Joseph',
            age: 42,
            color:'orange',
            id: 2
        },
        {
            name: 'Kevin',
            age: 35,
            color: 'brown',
            id: 3
        }
    ];

    return(
        <div>
            {params.id.name}
            {params.id.age}
            {params.id.color}
            {params.id.id}
        </div>
    )
}

export default DataPage();
